query:
/*+ NoHashJoin(t mc) NoHashJoin(mc t mi_idx) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id = 1 AND t.production_year > 1974 AND mc.company_id > 163856 AND mc.company_type_id = 2
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id;
